import React from "react";
import { Segment } from "semantic-ui-react";

function Header() {
  return (
    <Segment inverted padded="very" vertical>
      <h1 class="ui header">First header</h1>
      <h3 class="ui header">Subheader</h3>
    </Segment>
  );
}

export default Header;
